from sklearn.feature_extraction.text import CountVectorizer

from sklearn.feature_extraction.text import TfidfTransformer

from sklearn.metrics.pairwise import cosine_similarity

corpus = []
ids = []
with open("dataset/raw/dim_items_new.txt", "r") as f:
    for line in f:
        print(line)
        a=line.replace("\n","").split(" ")[2]
        corpus.append(a)
        id = line.split(" ")[0]
        ids.append(id)
print(corpus)
print("corpus len is :",len(corpus))
print(ids)
print(corpus.__len__())
print(ids.__len__())

# 将文本中的词语转换为词频矩阵
vectorizer = CountVectorizer()
# 计算个词语出现的次数
X = vectorizer.fit_transform(corpus)
# 获取词袋中所有文本关键词
word = vectorizer.get_feature_names()
print(word)
print("word count: ",len(word))
# 查看词频结果
print(X.toarray())

# 类调用
transformer = TfidfTransformer()
print(transformer)

#将词频矩阵X统计成TF-IDF值
tfidf = transformer.fit_transform(X)
#查看数据结构 tfidf[i][j]表示i类文本中的tf-idf权重
print(tfidf.toarray())
print("************************************************************")
print(cosine_similarity(tfidf.toarray()))

matrix = cosine_similarity(tfidf.toarray())
print("************************************************************")

big_dict={}
for i in range(len(matrix)):

    small_dict ={}
    array=[] #每个key的值
    for j in range(len(matrix[i])):
        small_dict[ids[j]] = matrix[i][j]
        value_sorted_dic = sorted(small_dict.items(), key=lambda x: x[1], reverse=True)
    for item in value_sorted_dic[1:201]: # 这里3代表截取的个数
        array.append(item[0])
    big_dict[ids[i]] = array

print(big_dict)

